description:
@criptoalquimia Grow Shop Cauquenes reúne los mejores productos disponibles en el mercado en un solo lugar. @criptoalquimia tienda especializada en sustratos, abonos, fertilizantes, semillas de colección, vaporizadores, armarios, iluminación interior, artículos para tabaco, cigarros electrónicos, grinders, pipas, macetas, accesorios, etc.
@criptoalquimia tienda especializada en sustratos, abonos, fertilizantes, semillas de colección, vaporizadores, armarios, iluminación interior, artículos para tabaco, cigarros electrónicos, grinders, pipas, macetas, accesorios, etc.

Contamos con un amplio catálogo de los más prestigiosos bancos de semillas de colección a nivel mundial:  Barney´s Farm, Blimburn Seeds, Buddha Seeds, Delicious, Dinafem, Dutch Passion, Eva Seeds, Fastbuds Seeds, Green House, Kannabia, Medical Seeds, Positronics, Pyramid, Royal Queen, Sweet Seeds, World of Seeds, etc… 
Actualmente, el shop cuenta con una amplia  variedad de diferentes tipos semillas para coleccionar: autoflorecientes, feminizadas, medicinales (CBD), fast version, regulares, almacenadas en óptimas condiciones de temperatura, humedad e iluminación.

Trabajamos con las mejores variedades medicinales del mercado.

Contamos con los mejores equipos medicinales para uso de hierbas vaporizadas.

Disponemos de una gran variedad de cigarros electrónicos y e-liquids de diversos aromas y sabores.

Tenemos con una amplia variedad de tabacos.

@criptoalquimia somos más que un Grow Shop.
